lay_url\":\"citinewsroom.com/2021/06/transp…\",\"images\":[{\"url\":\"https://pbs.twimg.com/news_img/1400167614039592964/k_T5T9vs?format=jpg&name=orig\",\"width\":750,\"height\":375},{\"url\":\"https://pbs.twimg.com/news_img/1400167614039592964/k_T5T9vs?format=jpg&name=150x150\",\"width\":150,\"height\":150}],\"status\":200,\"title\":\"Transport fares up by 13%; takes effect from Saturday\",\"description\":\"The Ghana Private Road Transport Union (GPRTU) has announced a 13 percent increment in transport fares effective Saturday, June 5,\",\"unwound_url\":\"https://citinewsroom.com/2021/06/transport-fares-up-by-13-takes-effect-from-saturday/\"}]},\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T19:37:30.000Z\"},{\"text\":\"I think it should be acceptable for people to just say, \\\"No, I'm not really interested in being friends or hanging out\\\" and that not to be considered rude. Think about all the anxiety that would spare if you could just know?!\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"id\":\"1400182101551484928\",\"conversation_id\":\"1400182101551484928\",\"public_metrics\":{\"retweet_count\":7,\"reply_count\":0,\"like_count\":8,\"quote_count\":1},\"author_id\":\"2357304633\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T20:06:41.000Z\"},{\"text\":\"On international sex workers day I want to thank all the sex workers whose work pushed me to be decarceral and ultimately an abolitionist!\\n\\nMay all of us continue to stand in solidarity and act in solidarity with you.\",\"lang\":\"en\",\"source\":\"Twitter for iPhone\",\"id\":\"1400178083290877960\",\"conversation_id\":\"1400178083290877960\",\"public_metrics\":{\"retweet_count\":60,\"reply_count\":0,\"like_count\":137,\"quote_count\":0},\"author_id\":\"1170413173515702273\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T19:50:43.000Z\"},{\"text\":\"On this day in “F*ck Around and Find Out” History... https://t.co/rlWEXOgpBh\",\"lang\":\"en\",\"source\":\"Twitter for iPhone\",\"id\":\"1399903740375617538\",\"conversation_id\":\"1399903740375617538\",\"attachments\":{\"media_keys\":[\"3_1399903737989107714\"]},\"public_metrics\":{\"retweet_count\":7680,\"reply_count\":106,\"like_count\":35777,\"quote_count\":351},\"author_id\":\"13906752\",\"entities\":{\"urls\":[{\"start\":53,\"end\":76,\"url\":\"https://t.co/rlWEXOgpBh\",\"expanded_url\":\"https://twitter.com/DrRDB/status/1399903740375617538/photo/1\",\"display_url\":\"pic.twitter.com/rlWEXOgpBh\"}]},\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T01:40:35.000Z\"},{\"text\":\"The arrest of the 21 LGBT+ activists in Ho is reminiscent of the state's dedication to violating the freedoms of LGBT+ people. \\n\\nIt's important now more than ever to bring attention to how this affects queer people across the country.\\n\\nJoin us for these conversations. \\uD83C\\uDDEC\\uD83C\\uDDED \\uD83C\\uDFF3️‍\\uD83C\\uDF08 https://t.co/gXnCRQ6RSq\",\"lang\":\"en\",\"source\":\"Twitter for iPhone\",\"in_reply_to_user_id\":\"215779616\",\"id\":\"1400174436884566017\",\"conversation_id\":\"1400174085724852229\",\"attachments\":{\"media_keys\":[\"16_1400174429901049860\"]},\"public_metrics\":{\"retweet_count\":17,\"reply_count\":1,\"like_count\":32,\"quote_count\":0},\"author_id\":\"215779616\",\"entities\":{\"annotations\":[{\"start\":40,\"end\":41,\"probability\":0.82,\"type\":\"Place\",\"normalized_text\":\"Ho\"}],\"urls\":[{\"start\":277,\"end\":300,\"url\":\"https://t.co/gXnCRQ6RSq\",\"expanded_url\":\"https://twitter.com/MsLadyPhyll/status/1400174436884566017/photo/1\",\"display_url\":\"pic.twitter.com/gXnCRQ6RSq\"}]},\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T19:36:14.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400174085724852229\"}]},{\"text\":\"We view pride as a celebration and a protest. \\uD83C\\uDF89\u270a\\uD83C\\uDFFF \\n\\nA celebration of queer and trans people and a protest against the injustices LGBT+ people face in Ghana, Africa &amp; beyond.\\uD83C\\uDFF3️‍\\uD83C\\uDF08 \\uD83C\\uDDEC\\uD83C\\uDDED \\n\\nWe will be using these hashtags for Pride\\n#GhPride2021 \\n#ReleaseAllThe21 #QueerGhanaianLivesMatter https://t.co/TG99HZfWZ4\",\"lang\":\"en\",\"context_annotations\":[{\"domain\":{\"id\":\"119\",\"name\":\"Holiday\",\"description\":\"Holidays like Christmas or Halloween\"},\"entity\":{\"id\":\"1275179649987784704\",\"name\":\"International Pride Day\"}}],\"source\":\"Twitter for iPhone\",\"id\":\"1400174085724852229\",\"conversation_id\":\"1400174085724852229\",\"attachments\":{\"media_keys\":[\"3_1400174079253135366\"]},\"entities\":{\"hashtags\":[{\"start\":229,\"end\":241,\"tag\":\"GhPride2021\"},{\"start\":243,\"end\":259,\"tag\":\"ReleaseAllThe21\"},{\"start\":260,\"end\":285,\"tag\":\"QueerGhanaianLivesMatter\"}],\"annotations\":[{\"start\":152,\"end\":156,\"probability\":0.9954,\"type\":\"Place\",\"normalized_text\":\"Ghana\"},{\"start\":159,\"end\":164,\"probability\":0.6284,\"type\":\"Place\",\"normalized_text\":\"Africa\"}],\"urls\":[{\"start\":286,\"end\":309,\"url\":\"https://t.co/TG99HZfWZ4\",\"expanded_url\":\"https://twitter.com/MsLadyPhyll/status/1400174085724852229/photo/1\",\"display_url\":\"pic.twitter.com/TG99HZfWZ4\"}]},\"public_metrics\":{\"retweet_count\":68,\"reply_count\":6,\"like_count\":174,\"quote_count\":1},\"author_id\":\"215779616\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T19:34:50.000Z\"},{\"text\":\"A lot of leftists in imperialist countries don't understand that people in the global south are not fighting against \\\"the state\\\" or \\\"hierarchy\\\" in the abstract. They're fighting against the US and its allies. If you wanna be in solidarity with them, fight your own government.\",\"lang\":\"en\",\"source\":\"Twitter for Android\",\"id\":\"1400103926028963840\",\"conversation_id\":\"1400103926028963840\",\"public_metrics\":{\"retweet_count\":1039,\"reply_count\":22,\"like_count\":4816,\"quote_count\":37},\"author_id\":\"1218926786727305222\",\"entities\":{\"annotations\":[{\"start\":190,\"end\":191,\"probability\":0.9572,\"type\":\"Place\",\"normalized_text\":\"US\"}]},\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T14:56:03.000Z\"},{\"entities\":{\"mentions\":[{\"start\":49,\"end\":64,\"username\":\"Boydell_Africa\"}],\"urls\":[{\"start\":66,\"end\":89,\"url\":\"https://t.co/c31egv5mWz\",\"expanded_url\":\"https://twitter.com/EmmaWildWood1/status/1399830309307305992/photo/1\",\"display_url\":\"pic.twitter.com/c31egv5mWz\"}]},\"text\":\"Important new book from my fellow series editor \u2066@Boydell_Africa\u2069 https://t.co/c31egv5mWz\",\"lang\":\"en\",\"source\":\"Twitter for iPhone\",\"id\":\"1399830309307305992\",\"conversation_id\":\"1399830309307305992\",\"attachments\":{\"media_keys\":[\"3_1399830299576569862\"]},\"public_metrics\":{\"retweet_count\":34,\"reply_count\":1,\"like_count\":154,\"quote_count\":3},\"author_id\":\"1132663111192842240\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-01T20:48:47.000Z\"},{\"entities\":{\"mentions\":[{\"start\":55,\"end\":65,\"username\":\"SMajority\"}],\"urls\":[{\"start\":153,\"end\":176,\"url\":\"https://t.co/B9TdNweP0x\",\"expanded_url\":\"https://www.silentmajorityghana.com/family-acceptance-week\",\"display_url\":\"silentmajorityghana.com/family-accepta…\"},{\"start\":177,\"end\":200,\"url\":\"https://t.co/jEVSo16pUS\",\"expanded_url\":\"https://twitter.com/smajoritygh/status/1400110057870737409\",\"display_url\":\"twitter.com/smajoritygh/st…\"}]},\"text\":\"You can share your own stories to the hashtag or visit @smajority website to tell us more about what these narratives of family acceptance mean to you - https://t.co/B9TdNweP0x https://t.co/jEVSo16pUS\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"id\":\"1400152176329170944\",\"conversation_id\":\"1400152176329170944\",\"public_metrics\":{\"retweet_count\":4,\"reply_count\":0,\"like_count\":4,\"quote_count\":0},\"author_id\":\"187213146\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T18:07:47.000Z\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1400110057870737409\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":10,\"username\":\"Daavi_Aku\"},{\"start\":11,\"end\":22,\"username\":\"wunpini_fm\"},{\"start\":23,\"end\":31,\"username\":\"nahaja_\"}]},\"text\":\"@Daavi_Aku @wunpini_fm @nahaja_ I didn’t want to drag this.. because they have a genuine concern\",\"lang\":\"en\",\"source\":\"Twitter for iPhone\",\"in_reply_to_user_id\":\"309037914\",\"id\":\"1400165733741568006\",\"conversation_id\":\"1400116247740796936\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":0,\"quote_count\":0},\"author_id\":\"197794984\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T19:01:39.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400161279537553410\"}]},{\"entities\":{\"mentions\":[{\"start\":122,\"end\":134,\"username\":\"smajoritygh\"}],\"hashtags\":[{\"start\":222,\"end\":247,\"tag\":\"QueerGhanaianLivesMatter\"},{\"start\":248,\"end\":260,\"tag\":\"GhPride2021\"}],\"urls\":[{\"start\":261,\"end\":284,\"url\":\"https://t.co/MD6yLR1NVi\",\"expanded_url\":\"https://twitter.com/animaadjepong/status/1400151354803470342/video/1\",\"display_url\":\"pic.twitter.com/MD6yLR1NVi\"}]},\"text\":\"Queer Ghanaians often experience the pain of family rejection and loneliness. But that is not always the case. This week, @smajoritygh is highlighting stories of family acceptance to counter the dominant narrative because #QueerGhanaianLivesMatter #GhPride2021 https://t.co/MD6yLR1NVi\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"id\":\"1400151354803470342\",\"conversation_id\":\"1400151354803470342\",\"attachments\":{\"media_keys\":[\"7_1400149772820959236\"]},\"public_metrics\":{\"retweet_count\":13,\"reply_count\":0,\"like_count\":27,\"quote_count\":0},\"author_id\":\"187213146\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T18:04:31.000Z\"},{\"entities\":{\"mentions\":[{\"start\":60