vel entities that describe a Brands industry\"},\"entity\":{\"id\":\"781974597310615553\",\"name\":\"Entertainment\"}},{\"domain\":{\"id\":\"46\",\"name\":\"Brand Category\",\"description\":\"Categories within Brand Verticals that narrow down the scope of Brands\"},\"entity\":{\"id\":\"781974597105094656\",\"name\":\"TV/Movies Related\"}},{\"domain\":{\"id\":\"47\",\"name\":\"Brand\",\"description\":\"Brands and Companies\"},\"entity\":{\"id\":\"10037284711\",\"name\":\"Disney\"}}],\"source\":\"Twitter for iPhone\",\"id\":\"1400132033763065856\",\"conversation_id\":\"1400132033763065856\",\"attachments\":{\"media_keys\":[\"3_1400132029535207436\"]},\"public_metrics\":{\"retweet_count\":9,\"reply_count\":10,\"like_count\":42,\"quote_count\":3},\"author_id\":\"826650721542082560\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T16:47:44.000Z\"},{\"entities\":{\"mentions\":[{\"start\":68,\"end\":78,\"username\":\"SMajority\"}],\"hashtags\":[{\"start\":46,\"end\":58,\"tag\":\"GhPride2021\"}],\"urls\":[{\"start\":167,\"end\":190,\"url\":\"https://t.co/Yqp5FzQvfI\",\"expanded_url\":\"https://www.silentmajorityghana.com/family-acceptance-week\",\"display_url\":\"silentmajorityghana.com/family-accepta…\",\"status\":200,\"title\":\"Family Acceptance Week — Silent Majority, Ghana\",\"unwound_url\":\"https://www.silentmajorityghana.com/family-acceptance-week\"}]},\"text\":\"You can share your own stories to the hashtag #GhPride2021 or visit @smajority website to tell us more about what these narratives of family acceptance mean to you \\uD83D\\uDC47\\uD83C\\uDFFF https://t.co/Yqp5FzQvfI\",\"lang\":\"en\",\"source\":\"Twitter for Android\",\"in_reply_to_user_id\":\"1365695747052691456\",\"id\":\"1400152461453692929\",\"conversation_id\":\"1400110057870737409\",\"public_metrics\":{\"retweet_count\":5,\"reply_count\":0,\"like_count\":2,\"quote_count\":0},\"author_id\":\"1365695747052691456\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T18:08:55.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400110063059079172\"}]},{\"text\":\"Visit our website for all the programs we have scheduled for this week\\n\\nhttps://t.co/Yqp5FzQvfI\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"1365695747052691456\",\"id\":\"1400110063059079172\",\"conversation_id\":\"1400110057870737409\",\"public_metrics\":{\"retweet_count\":7,\"reply_count\":1,\"like_count\":5,\"quote_count\":0},\"author_id\":\"1365695747052691456\",\"entities\":{\"urls\":[{\"start\":72,\"end\":95,\"url\":\"https://t.co/Yqp5FzQvfI\",\"expanded_url\":\"https://www.silentmajorityghana.com/family-acceptance-week\",\"display_url\":\"silentmajorityghana.com/family-accepta…\",\"status\":200,\"title\":\"Family Acceptance Week — Silent Majority, Ghana\",\"unwound_url\":\"https://www.silentmajorityghana.com/family-acceptance-week\"}]},\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T15:20:26.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400110062178390016\"}]},{\"text\":\"...being unlawfully held in Ho Prisons, the repeal of Ghana’s Section 104, and the government’s fulfillment of our constitutionally mandated protections #releaseallthe21 \\n#QueerGhanaianLivesMatter\\n#GHPride2021\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"1365695747052691456\",\"id\":\"1400110062178390016\",\"conversation_id\":\"1400110057870737409\",\"entities\":{\"hashtags\":[{\"start\":153,\"end\":169,\"tag\":\"releaseallthe21\"},{\"start\":171,\"end\":196,\"tag\":\"QueerGhanaianLivesMatter\"},{\"start\":197,\"end\":209,\"tag\":\"GHPride2021\"}],\"annotations\":[{\"start\":28,\"end\":37,\"probability\":0.5896,\"type\":\"Place\",\"normalized_text\":\"Ho Prisons\"},{\"start\":54,\"end\":58,\"probability\":0.9609,\"type\":\"Place\",\"normalized_text\":\"Ghana\"}]},\"public_metrics\":{\"retweet_count\":8,\"reply_count\":1,\"like_count\":8,\"quote_count\":0},\"author_id\":\"1365695747052691456\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T15:20:26.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400110061293346816\"}]},{\"text\":\"As we celebrate the love and repair that comes through family acceptance, we remain firm in our fight for absolute social inclusion, which includes our demands for the immediate release of all 21 activists...\\n\\n#ReleaseAllthe21\\n#QueerGhanaianLivesMatter\\n#GHPride2021\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"1365695747052691456\",\"id\":\"1400110061293346816\",\"conversation_id\":\"1400110057870737409\",\"entities\":{\"hashtags\":[{\"start\":210,\"end\":226,\"tag\":\"ReleaseAllthe21\"},{\"start\":227,\"end\":252,\"tag\":\"QueerGhanaianLivesMatter\"},{\"start\":253,\"end\":265,\"tag\":\"GHPride2021\"}]},\"public_metrics\":{\"retweet_count\":9,\"reply_count\":1,\"like_count\":8,\"quote_count\":1},\"author_id\":\"1365695747052691456\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T15:20:26.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400110059447783430\"}]},{\"text\":\"Our hope is that for those navigating the pain of rejection, you may see possibilities for something better; for those  on that bumpy road towards acceptance, it smooths out; and for those who have chosen not to take this path, to know that their choices are equally valid.\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"1365695747052691456\",\"id\":\"1400110059447783430\",\"conversation_id\":\"1400110057870737409\",\"public_metrics\":{\"retweet_count\":8,\"reply_count\":1,\"like_count\":6,\"quote_count\":0},\"author_id\":\"1365695747052691456\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T15:20:25.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400110057870737409\"}]},{\"text\":\"The prevailing narratives about queer and trans* Ghanaians is one of family and social rejection. Yet there’s more to our stories.\\n\\nCheck out our SM pages &amp; website for narratives about the journey towards family acceptance.\\n#QueerGhanaianLivesMatter\\n#GhPride2021\\n#ReleaseAllthe21 https://t.co/dAPvl8ZwRd\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"id\":\"1400110057870737409\",\"conversation_id\":\"1400110057870737409\",\"attachments\":{\"media_keys\":[\"7_1400108397136158721\"]},\"entities\":{\"hashtags\":[{\"start\":229,\"end\":254,\"tag\":\"QueerGhanaianLivesMatter\"},{\"start\":255,\"end\":267,\"tag\":\"GhPride2021\"},{\"start\":268,\"end\":284,\"tag\":\"ReleaseAllthe21\"}],\"urls\":[{\"start\":285,\"end\":308,\"url\":\"https://t.co/dAPvl8ZwRd\",\"expanded_url\":\"https://twitter.com/smajoritygh/status/1400110057870737409/video/1\",\"display_url\":\"pic.twitter.com/dAPvl8ZwRd\"}]},\"public_metrics\":{\"retweet_count\":50,\"reply_count\":1,\"like_count\":80,\"quote_count\":4},\"author_id\":\"1365695747052691456\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-02T15:20:25.000Z\"},{\"text\":\"We support sex workers, especially Black sex workers. We stand in solidarity with Black sex workers in Africa &amp; in the African Diaspora. \u2728\\n\\nToday &amp; everyday, support Black sex workers. \\n\\n#blackwomenradicals\\n#InternationalWhoresDay #HappyInternationalWhoresDay https://t.co/2ULKYsUGXt\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"id\":\"1400151008890720259\",\"conversation_id\":\"1400151008890720259\",\"attachments\":{\"media_keys\":[\"3_1400149942749040642\"]},\"entities\":{\"hashtags\":[{\"start\":195,\"end\":214,\"tag\":\"blackwomenradicals\"},{\"start\":215,\"end\":238,\"tag\":\"InternationalWhoresDay\"},{\"start\":239,\"end\":267,\"tag\":\"HappyInternationalWhoresDay\"}],\"annotations\":[{\"start\":103,\"end\":108,\"probability\":0.9871,\"type\":\"Place\",\"normalized_text\":\"Africa\"},{\"start\":119,\"end\":134,\"probability\":0.4237,\"type\":\"Place\",\"normalized_text\":\"African Diaspora\"}],\"urls\":[{\"start\":268,\"end\":291,\"url\":\"https://t.co/2ULKYsUGXt\",\"expan